import { Box, Container } from '@mui/system';
import React from 'react';
import { 
    FormControlLabel,
    Checkbox,
    } from '@mui/material';


const Checkout = () => {
  return (
    <Container>
        <FormControlLabel
          value="selectAll"
          control={<Checkbox sx={{marginLeft:'35px'}} />}
          label="Pilih Semua"
          labelPlacement="end"
        />
    </Container>
  )
}

export default Checkout
